import axios from 'axios';
export const GET_PERROS="GET_PERROS";
export const getPerros = () => {
  return async (dispatch) => {
   const apiData = await axios.get('http://localhost:3001/dogsall');
   const perros = apiData.data;
   dispatch({type:GET_PERROS, payload: perros });
  };
};
